%BA_(II)\" class=\"mw-redirect\" title=\"\u0411\u0440\u0438\u0442\u0430\u043d\u043d\u0438\u043a (II)\">\u00ab\u0411\u0440\u0438\u0442\u0430\u043d\u043d\u0438\u043a\u00bb<\/a>&#160;\u2014 \u043a\u043e\u0440\u0430\u0431\u043b\u044c-\u0431\u043b\u0438\u0437\u043d\u0435\u0446 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D0%BA\" title=\"\u0422\u0438\u0442\u0430\u043d\u0438\u043a\">\u0422\u0438\u0442\u0430\u043d\u0438\u043a\u0430<\/a>\u00bb, \u043d\u0430\u043b\u0435\u0442\u0435\u0432 \u043d\u0430 \u043d\u0435\u043c\u0435\u0446\u043a\u0443\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%BC%D0%B8%D0%BD%D0%B0\" title=\"\u041c\u043e\u0440\u0441\u043a\u0430\u044f \u043c\u0438\u043d\u0430\">\u043c\u0438\u043d\u0443<\/a>. \u041e\u043d \u0443\u0448\u0451\u043b \u043d\u0430 \u0434\u043d\u043e \u0432\u0441\u0435\u0433\u043e \u0437\u0430 57 \u043c\u0438\u043d\u0443\u0442, \u0442\u0435\u043c \u043d\u0435 \u043c\u0435\u043d\u0435\u0435, \u043f\u043e\u0433\u0438\u0431\u043b\u0438 \u0442\u043e\u043b\u044c\u043a\u043e 30 \u0447\u0435\u043b\u043e\u0432\u0435\u043a, \u0442\u0430\u043a \u043a\u0430\u043a \u0431\u044b\u043b\u0438 \u0438\u0437\u0432\u043b\u0435\u0447\u0435\u043d\u044b \u0443\u0440\u043e\u043a\u0438 \u0438\u0437 \u0433\u0438\u0431\u0435\u043b\u0438 \u00ab\u0422\u0438\u0442\u0430\u043d\u0438\u043a\u0430\u00bb \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1912_%D0%B3%D0%BE%D0%B4\" title=\"1912 \u0433\u043e\u0434\">1912<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%83%D0%B7%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F_(%D0%BB%D0%B0%D0%B9%D0%BD%D0%B5%D1%80)\" title=\"\u041b\u0443\u0437\u0438\u0442\u0430\u043d\u0438\u044f (\u043b\u0430\u0439\u043d\u0435\u0440)\">\u00ab\u041b\u0443\u0437\u0438\u0442\u0430\u043d\u0438\u0438\u00bb<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1915_%D0%B3%D0%BE%D0%B4\" title=\"1915 \u0433\u043e\u0434\">1915<\/a>. \u042d\u0432\u0430\u043a